import React from "react";
import "./contact.css";

import { faGitHub, faLinkedIn } from "@fortawesome/free-brands-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Contacts = () => {
  return (
    <div className="contact-pg">
      <h4 className="contact-header">Contact Us</h4>

      <div className="contact-container">
          <div className='contact'>
            <img src='https://media-exp1.licdn.com/dms/image/C4E35AQHL1X2ger4r4w/profile-framedphoto-shrink_200_200/0/1608068205428?e=1608246000&v=beta&t=6joWJLZlx6s4yheTlcjarpMDpQLi_bzKFxY0Hw-vlaI' alt='contact-tim'/>
                <div className='contact-info'>
                    <p>Team Leader</p>
                    <div className='contact-links'>
                        <a href='https://github.com/tbeddy' className='contact-git' target="_blank"><FontAwesomeIcon icon={ faGitHub}/> </a>
                    </div>
                </div>
          </div>
      </div>
    </div>
  );
};

export default Contacts;
